What is the number of centimeters in the length of $EF$ if $AB\parallel CD\parallel EF$?

[asy]

size(4cm,4cm);
pair A,B,C,D,E,F,X;

A=(0,1);
B=(1,1);
C=(1,0);
X=(0,0);
D=(1/3)*C+(2/3)*X;

draw (A--B--C--D);
draw(D--B);
draw(A--C);

E=(0.6,0.4);
F=(1,0.4);

draw(E--F);

label("$A$",A,NW);
label("$B$",B,NE);
label("$C$",C,SE);
label("$D$",D,SW);
label("$E$",shift(-0.1,0)*E);
label("$F$",F,E);

label("$100$ cm",midpoint(C--D),S);
label("$150$ cm",midpoint(A--B),N);

[/asy]
